=head1 DESCRIPTION

Describes the last time an access key was used.

This object does not include data in the response of a
CreateBucketAccessKey
(https://docs.aws.amazon.com/lightsail/2016-11-28/api-reference/API_CreateBucketAccessKey.html)
action.

=head1 ATTRIBUTES


=head2 LastUsedDate => Str

The date and time when the access key was most recently used.

This value is null if the access key has not been used.


=head2 Region => Str

The Amazon Web Services Region where this access key was most recently
used.

This value is C<N/A> if the access key has not been used.


=head2 ServiceName => Str

The name of the Amazon Web Services service with which this access key
was most recently used.

This value is C<N/A> if the access key has not been used.



